query:
{
  rateLimit {
    limit
    cost
    remaining
    resetAt
  }
  repository(name: "pytorch", owner: "pytorch") {
    name
    pullRequests(first: 50, orderBy: {field: COMMENTS, direction: DESC}) {
      nodes {
        participants(first: 1) {
          totalCount
          nodes {
            following(first: 1) {
              totalCount
              nodes {
                repositories(first: 1, orderBy: {field: STARGAZERS, direction: DESC}) {
                  nodes {
                    stargazers(first: 10) {
                      totalCount
                      nodes {
                        location
                      }
                    }
                  }
                }
              }
            }
          }
        }
      }
    }
  }
}

